import { Outlet, Link } from "react-router-dom";
import "../src/styles/layout.css";

const Layout = () => {
  return (
    <>
      <nav>
        <div className="banner">
          <h2 className="bannerHome"><Link to="/" style="text-decoration: none">Flashcard</Link></h2>
          <h2 className="bannerBoobPage"><Link to="/boobPage"style="text-decoration: none">Boob Page</Link></h2>
        </div>
      </nav>

      <Outlet />
    </>
  )
};

export default Layout;
